import React from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import Header from "./Header";
import "bootstrap/dist/css/bootstrap.css";
import axios from "axios";

const PostbaseURL =
  "https://react-training-mobcoder-default-rtdb.firebaseio.com/userdata.json";

const LoginSchema = Yup.object().shape({
  email: Yup.string()
    .email("Invalid email address format")
    .required("Email is required"),
  firstname: Yup.string()
    .min(3, "firstname must be 3 characters at minimum")
    .max(15, "firstname must be 15 characters at maximum")
    // .text("Only Character can enter")
    .required("firstname is required"),
  lastname: Yup.string()
    .min(3, "lastname must be 3 characters at minimum")
    .max(15, "lastname must be 15 characters at maximum")
    .required("firstname is required"),
  // .text("Only Character can enter"),
  phonenumber: Yup.string()
    .max(10, "phone numnber must be 10 digit")
    .required("phone number is required"),
});

function New() {
  <Formik
    initialValues={{
      email: "",
      firstname: "",
      lastname: "",
      phonenumber: "",
    }}
    validationSchema={LoginSchema}
    onSubmit={(values) => {


      console.log(values);
      alert("Form is validated! Submitting the form...");
    }}
  >
    function handleSub()
    {axios({
      method: "post",
      url: PostbaseURL,
      data: JSON.stringify(values), // you are sending body instead
      headers: {
        // 'Authorization': `bearer ${token}`,
        "Content-Type": "application/json",
      },
    }).then((response) => {
      console.log(response);
      //  navigate('/');
    })}
    return (
    <div>
      <Header />
      <br></br>
      <div className="container">
        <div className="row">
          <div className="col-lg-12">
            {({ touched, errors, isSubmitting, values }) =>
              !isSubmitting ? (
                <div>
                  <div className="row mb-5">
                    <div className="col-lg-12 text-center">
                      <h1 className="mt-5">Simple Form</h1>
                    </div>
                  </div>
                  <Form>
                    <div className="form-group">
                      <label htmlFor="firstname" className="mt-3">
                        firstname
                      </label>
                      <Field
                        type="text"
                        name="firstname"
                        placeholder="Enter firstname"
                        className={`mt-2 form-control
                      ${
                        touched.firstname && errors.firstname
                          ? "is-invalid"
                          : ""
                      }`}
                      />
                      <ErrorMessage
                        component="div"
                        name="firstname"
                        className="invalid-feedback"
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="lastname" className="mt-3">
                        Last Name
                      </label>
                      <Field
                        type="text"
                        name="lastname"
                        placeholder="Enter lastname"
                        className={`mt-2 form-control
                      ${
                        touched.lastname && errors.lastname ? "is-invalid" : ""
                      }`}
                      />
                      <ErrorMessage
                        component="div"
                        name="lastname"
                        className="invalid-feedback"
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="email">Email</label>
                      <Field
                        type="email"
                        name="email"
                        placeholder="Enter email"
                        autocomplete="off"
                        className={`mt-2 form-control
                      ${touched.email && errors.email ? "is-invalid" : ""}`}
                      />

                      <ErrorMessage
                        component="div"
                        name="email"
                        className="invalid-feedback"
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="phonenumber" className="mt-3">
                        Phone Number
                      </label>
                      <Field
                        type="number"
                        name="phonenumber"
                        placeholder="Enter phonenumber"
                        className={`mt-2 form-control
                      ${
                        touched.phonenumber && errors.phonenumber
                          ? "is-invalid"
                          : ""
                      }`}
                      />
                      <ErrorMessage
                        component="div"
                        name="phonenumber"
                        className="invalid-feedback"
                      />
                    </div>

                    <button
                      type="submit"
                      className="btn btn-primary btn-block mt-4"
                    >
                      Submit
                    </button>
                  </Form>
                </div>
              ) : (
                <div>
                  <h1 className="p-3 mt-5">Form Submitted</h1>

                  <div className="alert alert-success mt-3">
                    Thank for your connecting with us. Here's what we got from
                    you !
                  </div>
                  <ul className="list-group">
                    <li className="list-group-item">
                      First Name: {values.firstname}
                    </li>
                    <li className="list-group-item">
                      Last Name: {values.lastname}
                    </li>
                    <li className="list-group-item">Email: {values.email}</li>
                    <li className="list-group-item">
                      Phone number: {values.phonenumber}
                    </li>
                  </ul>
                </div>
              )
            }
          </div>
        </div>
      </div>
    </div>
    );
  </Formik>;
}

export default New;
